export const Todos = ({ todos = [] }) => {
  return (
    <ol>
      {todos.map(({ todo }) => (
        <TodoItem key={todo.id} todo={todo} />
      ))}
    </ol>
  );
};

const TodoItem = ({ todo }) => {
  return (
    <li>
      <span>{todo.title}</span>
    </li>
  );
};
